INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.029, 1, 105, 101, 122601, 1, 1, 1, 0, 110, 1.5, 160, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.014, 3, 111, 102, 122401, 2, 2, 0, 0, 105, 2.5, 120, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.017, 2, 105, 103, 122501, 3, 3, 0, 1, 110, 2.5, 350, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.016, 3, 105, 104, 107501, 4, 4, 0, 0, 110, 1.5, 130, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.014, 1, 105, 105, 107601, 5, 5, 1, 0, 110, 2.5, 160, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.029, 2, 103, 106, 107801, 6, 6, 0, 1, 120, 3.5, 255, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.013, 1, 103, 107, 110601, 7, 7, 1, 0, 120, 3.5, 160, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.014, 2, 103, 108, 110401, 8, 8, 0, 1, 110, 2.5, 350, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.012, 3, 100, 109, 110501, 9, 9, 0, 0, 105, 1.5, 130, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.014, 1, 103, 110, 115701, 10, 10, 1, 0, 105, 2.5, 200, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.071, 2, 103, 111, 113601, 11, 11, 0, 1, 105, 2.5, 350, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.014, 3, 103, 112, 107901, 12, 12, 0, 0, 120, 1.5, 130, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.022, 2, 105, 113, 108001, 13, 13, 1, 0, 110, 1.5, 200, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.031, 1, 108, 114, 110301, 14, 14, 1, 0, 110, 2.5, 160, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.036, 1, 105, 115, 107701, 15, 15, 0, 0, 110, 0.5, 130, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.048, 2, 95, 116, 113101, 16, 16, 0, 1, 110, 3.5, 350, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.043, 3, 105, 117, 113301, 17, 17, 0, 0, 105, 1.5, 130, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.018, 2, 95, 118, 113201, 18, 18, 0, 0, 105, 1.5, 130, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.021, 2, 108, 119, 117001, 19, 19, 1, 0, 110, 2.5, 160, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.036, 1, 105, 120, 113501, 20, 20, 0, 1, 110, 2.5, 255, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.02, 3, 105, 121, 113401, 21, 21, 0, 1, 105, 2.5, 350, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.018, 1, 105, 122, 110101, 22, 22, 0, 0, 110, 2.5, 130, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.03, 3, 111, 123, 110001, 23, 23, 1, 0, 105, 3.5, 160, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.027, 1, 103, 124, 117201, 24, 24, 0, 0, 110, 1.5, 130, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.02, 2, 108, 125, 117301, 25, 25, 1, 0, 105, 3.5, 160, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.04, 3, 105, 126, 117401, 26, 26, 0, 1, 110, 2.5, 350, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.009, 1, 105, 127, 117101, 27, 27, 0, 1, 110, 3.5, 350, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.022, 1, 105, 128, 122901, 28, 28, 0, 1, 120, 3.5, 255, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.028, 3, 105, 129, 122801, 29, 29, 0, 0, 110, 2.5, 130, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 1);
INSERT INTO `v1_317de34b1e15ab7a03063caa6a5f5385401710bf7e046e93e5b4bea4ed06924f` VALUES (0.023, 2, 108, 130, 122701, 30, 30, 1, 0, 105, 3.5, 130, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 0);
